import React from 'react'
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

function Gridpapers(props) {
    return (
        <div>
            <Grid onChange={props.onChange} container justify="center" spacing={2}>
            <Grid key={0} item>
                <Paper style={{width:"300px",height:"600px"}}>{onOverview}</Paper></Grid>
                <Grid key={1} item>
                <Paper style={{width:"300px",height:"600px"}}>1</Paper></Grid>
                <Grid key={2} item>
                <Paper style={{width:"300px",height:"600px"}}>1</Paper></Grid>
                <Grid key={3} item>
                <Paper style={{width:"300px",height:"600px"}}>1</Paper></Grid>
                </Grid> 
        </div>
    )
}

export default Gridpapers
